    mapping(uint256 => TerraformingRecipe) public terraformingRecipeMap;
    mapping(uint256 => TierUpgradeRecipe) public tierUpgradeRecipeMap;
    mapping(uint256 => bool) public tierUpgradeRequiredMap;
    mapping(uint256 => mapping(uint256 => bool)) public plotTierUpgradeMap;
    mapping(uint256 => uint256) public nextPlotReplenishTimestamp;
    mapping(uint256 => mapping(uint256 => uint256)) public nextTierReplenishTimestamp;

    address public taxAccount;
    address public planetPlots;
    address public tokenFacade;
    address public resources;
    address public plotState;

    uint256 public plotReplenishCooldownDuration;
    uint256 public tierReplenishCooldownDuration;

    uint256 public plotMaxReplenishValue;

    uint256 public minimumRentFallback;
    mapping(uint256 => uint256) public minimumTierRentMap;
    mapping(uint256 => uint256) public replenishedPlotTierMap;

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function initialize(
        address _planetPlots,
        address _plotState,
        address _tokenFacade,
        address _resources,
        address _taxAccount,
        address defaultAdmin
    ) public initializer {
        __AccessControl_init();
        __Pausable_init();
        __ReentrancyGuard_init();

        _grantRole(DEFAULT_ADMIN_ROLE, defaultAdmin);
        _grantRole(PAUSER_ROLE, defaultAdmin);
        _grantRole(GAME_CONTROL, defaultAdmin);

        taxAccount = _taxAccount;

        planetPlots = _planetPlots;
        plotState = _plotState;
        tokenFacade = _tokenFacade;
        resources = _resources;

        plotMaxReplenishValue = 50;
    }

    modifier onlyPlanetPlotOwner(uint tokenId) {
        require(
            IERC721(planetPlots).ownerOf(tokenId) == msg.sender,
            "PlanetPlotReplenish: not owner of plot"
        );
        _;
    }

    modifier onlyPlanetPlotOwnerBatch(uint[] calldata tokenIds) {
        for (uint256 i = 0; i < tokenIds.length; i++) {
            require(
                IERC721(planetPlots).ownerOf(tokenIds[i]) == msg.sender,
                "PlanetPlotReplenish: not owner of plot"
            );
        }
        _;
    }

    function _updateReplenishCooldown(
        uint256 plotId,
        uint256 tier
    ) internal {
        uint256 nextPlotReplTs = nextPlotReplenishTimestamp[plotId];
        uint256 nextTierReplTs = nextTierReplenishTimestamp[plotId][tier];

        require(
            nextPlotReplTs < block.timestamp,
            "PlanetPlotReplenish: plot replenish cooldown violated"
        );

        require(
            nextTierReplTs < block.timestamp,
            "PlanetPlotReplenish: tier specific replenish cooldown violated"
        );

        nextPlotReplenishTimestamp[plotId] = block.timestamp + plotReplenishCooldownDuration;
        nextTierReplenishTimestamp[plotId][tier] = block.timestamp + tierReplenishCooldownDuration;
    }

    function _replenishPlot(
        address planetPlotOwner,
        uint256 plotId,
        uint256 recipeId,
        uint256 rent
    ) internal {
        require(
            recipeId > 0,
            "PlanetPlotReplenish: recipeId invalid"
        );

        TerraformingRecipe memory recipe = terraformingRecipeMap[recipeId];
        if(tierUpgradeRequiredMap[recipe.tier]) {
            require(
                plotTierUpgradeMap[plotId][recipe.tier],
                "PlanetPlotReplenish: plot not upgraded"
            );
        }

        _updateReplenishCooldown(plotId, recipe.tier);
        _setPlotRent(planetPlotOwner, plotId, recipe.tier, rent);

        ITokenFacade(tokenFacade).erc1155_burnBatch(
            resources,
            planetPlotOwner,
            recipe.resourceIds,
            recipe.resourceAmounts
        );

        IPlotState(plotState).setLeft(plotId, plotMaxReplenishValue);
        replenishedPlotTierMap[plotId] = recipe.tier;

        emit ReplenishPlot(
            planetPlotOwner,
            plotId,
            recipeId,
            nextPlotReplenishTimestamp[plotId],
            nextTierReplenishTimestamp[plotId][recipe.tier]
        );
    }

    function _setPlotRent(
        address planetPlotOwner,
        uint256 plotId,
        uint256 tier,
        uint256 rent
    ) internal {
        uint256 minimumRent = minimumTierRentMap[tier];
        if(minimumRent == 0) {
            minimumRent = minimumRentFallback;
        }

        require(
            rent >= minimumRent,
            "PlanetPlotReplenish: rent invalid"
        );

        IPlotState(plotState).setRent(plotId, rent);

        emit PlotRentSet(planetPlotOwner, plotId, tier, rent);
    }

    function setPlotRent(
        uint256 plotId,
        uint256 rent
    ) external onlyPlanetPlotOwner(plotId) whenNotPaused {
        address planetPlotOwner = _msgSender();
        uint256 tier = replenishedPlotTierMap[plotId];

        _setPlotRent(planetPlotOwner, plotId, tier, rent);
    }

    function setPlotRentBatch(
        uint256[] calldata plotIds,
        uint256[] calldata rentValues
    ) external onlyPlanetPlotOwnerBatch(plotIds) whenNotPaused {
        require(
            plotIds.length == rentValues.length,
            "PlanetPlotReplenish: array size mismatch"
        );

        address planetPlotOwner = _msgSender();
        for (uint256 i = 0; i < plotIds.length; i++) {
            uint256 tier = replenishedPlotTierMap[plotIds[i]];
            _setPlotRent(planetPlotOwner, plotIds[i], tier, rentValues[i]);
        }
    }

    function replenishPlot(
        uint256 plotId,
        uint256 recipeId,
        uint256 rent
    ) external onlyPlanetPlotOwner(plotId) whenNotPaused {
        address planetPlotOwner = _msgSender();
        _replenishPlot(planetPlotOwner, plotId, recipeId, rent);
    }

    function replenishPlotBatch(
        uint256[] calldata plotIds,
        uint256[] calldata recipeIds,
        uint256[] calldata rents
    ) external onlyPlanetPlotOwnerBatch(plotIds) whenNotPaused {
        require(
            plotIds.length == recipeIds.length,
            "PlanetPlotReplenish: array size mismatch"
        );

        address planetPlotOwner = _msgSender();
        for (uint256 i = 0; i < plotIds.length; i++) {
            _replenishPlot(planetPlotOwner, plotIds[i], recipeIds[i], rents[i]);
        }
    }

    function _upgradePlot(
        address planetPlotOwner,
        uint256 plotId,
        uint256 recipeId
    ) internal {
        TierUpgradeRecipe memory recipe = tierUpgradeRecipeMap[recipeId];
        require(
            !plotTierUpgradeMap[plotId][recipe.tiers[0]],
            "PlanetPlotReplenish: plot already upgraded"
        );

        uint256 darAmountToRevenue = recipe.darAmount;
        require(
            darAmountToRevenue > 0,
            "PlanetPlotReplenish: recipe invalid"
        );

        ITokenFacade(tokenFacade).dar_transferFrom(
            planetPlotOwner,
            taxAccount,
            darAmountToRevenue
        );

        for (uint256 i = 0; i < recipe.tiers.length; i++) {
            plotTierUpgradeMap[plotId][recipe.tiers[i]] = true;
        }

        emit PlotTierUpgraded(planetPlotOwner, plotId, recipe.tiers, recipe.darAmount);
    }

    function upgradePlotFor(
        uint256 plotId,
        uint256[] calldata tiers
    ) external onlyRole(GAME_CONTROL) {
        for (uint256 i = 0; i < tiers.length; i++) {
            plotTierUpgradeMap[plotId][tiers[i]] = true;
        }

        emit PlotTierUpgraded(
            IERC721(planetPlots).ownerOf(plotId),
            plotId,
            tiers,
            0
        );
    }

    function upgradePlot(
        uint256 plotId,
        uint256 recipeId
    ) external onlyPlanetPlotOwner(plotId) whenNotPaused {
        address planetPlotOwner = _msgSender();
        _upgradePlot(planetPlotOwner, plotId, recipeId);
    }

    function upgradePlotBatch(
        uint256[] calldata plotIds,
        uint256[] calldata recipeIds
    ) external onlyPlanetPlotOwnerBatch(plotIds) whenNotPaused {
        require(
            plotIds.length == recipeIds.length,
            "PlanetPlotReplenish: array size mismatch"
        );

        address planetPlotOwner = _msgSender();
        for (uint256 i = 0; i < plotIds.length; i++) {
            _upgradePlot(planetPlotOwner, plotIds[i], recipeIds[i]);
        }
    }

    function _setTerraformingRecipe(
        uint256 id,
        TerraformingRecipe calldata recipe
    ) internal {
        require(
            terraformingRecipeMap[id].resourceIds.length == 0,
            "PlanetPlotReplenish: recipe already exists"
        );

        terraformingRecipeMap[id] = recipe;

        emit TerraformingRecipeSet(
            id,
            recipe.tier,
            recipe.resourceIds,
            recipe.resourceAmounts
        );
    }

    function setTerraformingRecipeBatch(
        uint256[] calldata ids,
        TerraformingRecipe[] calldata recipes
    ) external onlyRole(GAME_CONTROL) {
        require(
            ids.length == recipes.length,
            "PlanetPlotReplenish: array size mismatch"
        );

        for (uint256 i = 0; i < ids.length; i++) {
            _setTerraformingRecipe(ids[i], recipes[i]);
        }
    }

    function setTierUpgradeRecipe(
        uint256 recipeId,
        TierUpgradeRecipe calldata recipe
    ) external onlyRole(GAME_CONTROL) {
        require(
            recipe.darAmount > 0,
            "PlanetPlotReplenish: cost invalid"
        );

        tierUpgradeRecipeMap[recipeId] = recipe;

        for (uint256 i = 0; i < recipe.tiers.length; i++) {
            tierUpgradeRequiredMap[recipe.tiers[i]] = true;
        }

        emit TierUpgradeRecipeSet(
            recipeId,
            recipe.tiers,
            recipe.darAmount
        );
    }

    function setCooldownDuration(
        uint256 _plotReplenishCooldownDuration,
        uint256 _tierReplenishCooldownDuration
    ) external onlyRole(GAME_CONTROL) {
        plotReplenishCooldownDuration = _plotReplenishCooldownDuration;
        tierReplenishCooldownDuration = _tierReplenishCooldownDuration;

        emit ReplenishCooldownSet(plotReplenishCooldownDuration, tierReplenishCooldownDuration);
    }

    function setPlotMaxReplenishValue(
        uint256 value
    ) external onlyRole(GAME_CONTROL) {
        plotMaxReplenishValue = value;
    }

    function setMinimumTierRentBatch(
        uint256[] calldata tiers,
        uint256[] calldata rents
    ) external onlyRole(GAME_CONTROL) {
        require(
            tiers.length == rents.length,
            "PlanetPlotReplenish: array size mismatch"
        );

        for (uint256 i = 0; i < tiers.length; i++) {
            uint256 rent = rents[i];
            require(rent > 0, "PlanetPlotReplenish: rent invalid");

            minimumTierRentMap[tiers[i]] = rents[i];

            emit MinimumTierRentSet(tiers[i], rent);
        }
    }

    function setMinimumFallbackRent(
        uint256 value
    ) external onlyRole(GAME_CONTROL) {
        require(value > 0, "PlanetPlotReplenish: value invalid");
        minimumRentFallback = value;
    }

    function getTerraformingRecipe(
        uint256 recipeId
    ) external view returns(TerraformingRecipe memory) {
        return terraformingRecipeMap[recipeId];
    }

    function getTierUpgradeRecipe(
        uint256 recipeId
    ) external view returns(TierUpgradeRecipe memory) {
        return tierUpgradeRecipeMap[recipeId];
    }

    function pause() public onlyRole(PAUSER_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(PAUSER_ROLE) {
        _unpause();
    }
}
